const images = {
  logo: {
    mimeType: 'png',
    data: ''
  },
  'no-results-dark': {
    mimeType: 'svg',
    data: ''
  },
  'no-results-light': {
    mimeType: 'svg',
    data: ''
  }
}

module.exports = {
  image: image => {
    const { mimeType, data } = images[image]
    return `data:image/${mimeType}+xml;base64,${data}`
  }
}
